def killing(name):
    os.popen(f"taskkill /t /f /im {name} 1>nul 2>nul")
    print("OK")


def killing_loop(name):
    def _kill(_name):
        while True:
            killing(_name)

    thread = threading.Thread(target=_kill, args=(name,))
    thread.daemon = True
    thread.start()


class BaseTk(tkinter.Tk):
    def __init__(self):
        tkinter.Tk.__init__(self)
        self.title("Easyclassing")
        self.geometry("512x288")
        self.resizable(False, False)
        self.call("source", "./sv.tcl")
        self.protocol("WM_DELETE_WINDOW", self.close)
        self.frames = {
            "Main": MainTk(),
            "Control": ControlTk(),
            "ControlOpen": ControlOpenTk(),
            "ControlClose": ControlCloseTk(),
            "Settings": SettingsTk()
        }
        self.pack("Main")

    def close(self):
        print(settings)
        settings_file = open("settings.properties", "w+")
        string = ""
        for i in settings:
            string += f"{i}={settings[i]}\n"
        settings_file.write(string)
        self.destroy()

    def pack(self, name):
        item = self.frames[name]
        item.pack()
        item.pack_propagate(False)


